import React from 'react'
import { Link } from 'react-router-dom'


function ShopNav(){
    return(
        <div>
                <Link to="/">Главная</Link>  
                <Link to="/about">О сайте</Link>  
                <Link to="/products">Товары</Link>
        </div>
    )
}

export default ShopNav
